import React from 'react';
import PropTypes from 'prop-types';

const Layout = ({ children }) => {
  return (
    <div className="">
      <div>공통레이아웃</div>
      {children}
    </div>
  )
}

Layout.propTypes = {
  children: PropTypes.node.isRequired
}



export default Layout;
